import React from 'react'
class Dashboardheading extends React.Component{
    constructor(props){
        super()

    }
render(){
    return(
        <div className="main">
            <div className="heading">
                <div className="headingin">
                    <div className="in1">
                        <p>box1</p>
                    </div>
                    <div className="in2">
                        <p>box2</p>
                    </div>
                </div>
            </div>
        
        <style jsx>{`
        .main{
            width:100%;
        }
        .heading{
            display:flex;
            background:black;
            align-items:center;
            justify-content:center;
            margin-top:200px;
            width:100%;
        }
        .headingin{
            display:flex;
            width:70%;
            background:blue;
        }
        .in1{
            width:50%;
        }
        .in2{
            width:50%;
        }
        
        
        
        `}

        </style>
        
        
        
        
        </div>
    )


    }



}
export default Dashboardheading;
